#!/usr/bin/env python3

import sys

l, r, k = map(int, sys.stdin.readline().split())

if l > r:
    l, r = r, l

if l > k or r < k:
    print("-1")
    sys.exit(0)

for i in range(l, r + 1):
    print(i ** k)

def main():
    l, r, k = map(int, input().split())
    if l > r:
        l, r = r, l
    if l > k or r < k:
        print("-1")
        return
    res = []
    for i in range(l, r + 1):
        if i % k == 0:
            res.append(i)
    print(" ".join(map(str, res)))


if __name__ == '__main__':
    main()

import math

l, r, k = list(map(int, input().split()))

def power(x, y):
    if y == 0:
        return 1
    if y == 1:
        return x
    if y % 2 == 0:
        return power(x * x, y // 2)
    else:
        return x * power(x * x, (y - 1) // 2)


for i in range(l, r + 1):
    if power(k, i) > r:
        break
    if power(k, i) >= l:
        print(power(k, i), end=" ")

print()

def solve():
    l, r, k = map(int, input().split())
    if l > r:
        l, r = r, l
    res = []
    for i in range(l, r + 1):
        if i % k == 0:
            res.append(i)
    if len(res) == 0:
        print(-1)
    else:
        print(' '.join(map(str, res)))


if __name__ == '__main__':
    solve()
